// initialize LegoSet class
class LegoSet {
    constructor(name, number, year, pieces, numberOfPieces) {
        this._name = name;
        this._number = number;
        this._year = year;
        this._pieces = pieces;
        this._numberOfPieces = numberOfPieces;
    }
    get name() {
        return this._name;
    }
    get number() {
        return this._number;
    }
    get year() {
        return this._year;
    }
    get pieces() {
        return this._pieces;
    }
    get numberOfPieces() {
        return this._numberOfPieces;
    }
}

